oxy_webhelp_navlinks = {"desktop_private_client_workspace-d1947e224":{"topics":[{"title":"Desktop workspace's UI pages","href":"topics\/desktop_workspace_s_ui_pages.html","attributes":{"data-id":"desktop_workspace_s_ui_pages"},"menu":{"hasChildren":false},"tocID":"desktop_workspace_s_ui_pages-d1947e232","next":"desktop_workspace_s_ui_pages-d1947e232"},{"title":"Desktop tasks UI pages for Private Clients","shortdesc":"<p class=\"shortdesc\">Clients handle internet banking operations within specially designed UI pages. Those         banking operations we considered for Tasks. Changing card pin code, making new payment,         setting payment orders etc. are banking Tasks. Usually to gain a result you need to pass         some steps. To ease handling all task steps, special UI page is created.<\/p>","href":"topics\/privar_clients_tasks_ui_pages.html","attributes":{"data-id":"privar_clients_tasks_ui_pages"},"menu":{"hasChildren":false},"tocID":"privar_clients_tasks_ui_pages-d1947e303","next":"privar_clients_tasks_ui_pages-d1947e303"},{"title":"Desktop UI controls for Private Clients","shortdesc":"<p class=\"shortdesc\">UI control is a visual representative of  a task's step. Drop down menu, buttons,         fields etc. are UI controls. UI controls are usually connected to software application         source code steps (functions) and data.<\/p>","href":"topics\/privar_clients_steps_ui_controles.html","attributes":{"data-id":"privar_clients_steps_ui_controles"},"menu":{"hasChildren":false},"tocID":"privar_clients_steps_ui_controles-d1947e486","next":"privar_clients_steps_ui_controles-d1947e486"}]}};